Even with a choice between the windows and windows-sys crates , some developers may prefer to use completely standalone bindings. The windows-bindgen crate lets you generate entirely standalone bindings for Windows APIs with a single function call that you can run from a test to automate the generation of bindings. This can help to reduce your dependencies while continuing to provide a sustainable path forward for any future API requirements you might have, or just to refresh your bindings from time to time to pick up any bug fixes automatically from Microsoft. Warning : Standalone code generation should only be used as a last resort for the most demanding scenarios. It is much simpler to use the windows-sys crate and let Cargo manage this dependency. This windows-sys crate provides raw bindings, is heavily tested and widely used, and should not meaningfully impact your build time. Start by adding the following to your Cargo.toml file: [dependencies.windows-targets]
version = "0.48" [dev-dependencies.windows-bindgen]
version = "0.48" The windows-bindgen crate is only needed for generating bindings and is thus a dev dependency only. The windows-targets crate is a dependency shared by the windows and windows-sys crates and only contains import libs for supported targets. This will ensure that you can link against any Windows API functions you may need. Write a test to generate bindings as follows: #[test]
fn gen_bindings() { let apis = [ "Windows.Win32.System.SystemInformation.GetTickCount", ]; let bindings = windows_bindgen::standalone(&apis); std::fs::write("src/bindings.rs", bindings).unwrap();
} Make use of any Windows APIs as needed. mod bindings;
use bindings::*; fn main() { unsafe { println!("{}", GetTickCount()); }
}

